import { Injectable } from '@angular/core';

const DbcPreviewHtmlEncoded = '';
@Injectable({
  providedIn: 'root'
})
export class DbcPreviewService {
  
  constructor() { }
  
  getPreviewDataUri(modelEncoded){
    const model = atob(modelEncoded);
    const htmlContent = atob(DbcPreviewHtmlEncoded)
                         .replace("\"REPLACEME\"","atob('"+modelEncoded+"')")
                        //  .replace("https://databricks-prod-cloudfront.cloud.databricks.com/static/e3b0c44298fc1c149afbf4c8996fb92427ae41e4649b934ca495991b7852b855/js/notebook-main.js","./assets/js/notebook-main.js");
    return "data:text/html;base64,"+btoa(htmlContent);
  }
  
}
